--
-- Table structure for table `classlist`
--

DROP TABLE IF EXISTS `classlist`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `classlist` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `cellphone` varchar(100) NOT NULL,
  `url` varchar(2000) NOT NULL,
  `type` varchar(300) NOT NULL,
  `title` varchar(1500) NOT NULL,
  `src` varchar(2000) NOT NULL,
  `label` varchar(1000) NOT NULL,
  `longsrc` varchar(2000) NOT NULL COMMENT '长图',
  `longsrc1` varchar(2000) NOT NULL,
  `rema` int(11) NOT NULL COMMENT '被收藏数',
  `subject` int(1) NOT NULL COMMENT '学科',
  `hot` int(1) NOT NULL COMMENT '是否上推荐',
  `words` varchar(1000) NOT NULL,
  `pop` int(11) NOT NULL COMMENT '深受喜爱的',
  `zhongjunhot` int(11) NOT NULL COMMENT '少量余位的中军',
  `little` int(11) NOT NULL COMMENT '享有优惠 ',
  `grade` varchar(4000) NOT NULL COMMENT '年级',
  `campus` varchar(3000) NOT NULL COMMENT '校区',
  `nianji` text NOT NULL,
  `cardsrc1` varchar(1000) NOT NULL COMMENT '名片轮播图1',
  `cardsrc2` varchar(1000) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=137 DEFAULT CHARSET=utf8 COMMENT='课程/教师数据表';
/*!40101 SET character_set_client = @saved_cs_client */;

