INSERT INTO `commentreal` VALUES (1,1,'老师是一个认真负责 有上进心并且想要带着自己的学生一起变得更好变得更强大 成为自己想要的样子 有无限正能量的老师'),(4,47,'可爱的老师'),(6,64,'好老师'),(7,72,'莽子老师'),(8,85,'好'),(9,54,'数学'),(10,107,'好'),(11,42,'德高望重'),(12,61,'你好兔哦，我好喜欢……'),(13,46,'泡茶最好喝，上课最有逻辑的化学老师'),(14,61,'老王超帅 超爱老王'),(15,61,'很好的老师'),(16,61,'老王上课很幽默学起来很轻松！'),(17,61,'棒，很棒，真的非常棒，真心推荐'),(18,46,'陈老师的课很幽默上起来很轻松'),(19,61,'大帅哥大帅哥 超级搞笑重点是帅'),(20,46,'俊哥超级好，上课内容充实又有趣，俊哥是个宝藏化学老师'),(21,46,'北城最文艺最酷最有风格的化学老师'),(22,46,'俊哥超好，抱他的课稳赚不赔'),(23,46,'课程和人一样帅气个性 绝对听一次就爱上'),(24,61,'最幽默，最帅气的物理老师'),(25,46,'最喜欢的老师，没有之一'),(26,46,'化学教的真的很棒 真的真的很好'),(27,61,'老王人贼好，有时候还会有奶茶，上课还特别幽默'),(28,46,'俊哥是我见过的最最最最最好的化学老师，上课特别有趣幽默。大爱俊哥'),(29,61,'老王真的是非常实在的老师，经常有奶茶喝，在他的课上他收放自如，氛围轻松活泼，学习内容牢抓重点，攻破易错点。是学习与生活的良师益友。爱老王'),(30,46,'俊哥自体发光的美貌简直是人间水蜜桃，这种和太阳一起发光的美貌是真实的吗？即使实际看到也觉得难以置信的惊艳，让我范进式晕厥失血性休克马斯三百六十度转体跪地爆哭。'),(31,46,'北城彭于晏'),(32,61,'老王上课特别幽默，还特别帅，绝对不输易烊千玺，有时候还有奶茶'),(33,46,'俊哥化学教的真的超级好，她是我碰到的最好的化学老师大爱俊哥'),(34,61,'又帅，又可爱，又负责的老师，超级喜欢。'),(35,61,'老王真的是个很实在的老师，他的课经常会有奶茶喝，课堂上收放自如，氛围活泼快乐，真的是非常好的老师！❤️ ❤️'),(36,61,'王道物理！'),(37,61,'超级牛的物理老师 感谢老王 我从曾经物理D变成了A  各位报班不亏！！'),(38,46,'天人之姿——俊哥。兼才华与帅气于一体，语言幽默诙谐，良师益友。'),(39,46,'第一次上俊哥的课，俊哥就在课上手磨咖啡、用酒精灯来解释化学反应，那一节课我记得超级清楚，化学还可以这么有意思！这是我的第一反应，接下来的课我都认真地跟着俊哥的思路走，发现化学并不是那么难，反而很简单、很好理解。俊哥的课都是满满的干货，很多方法学校老师没讲过但是超级管用！'),(40,46,'如果化学于你是新学科，那俊哥就是那个会让你入门化学最好的老师，且让你的初高中化学成为优势学科。更重要的是，一个好的老师，和学科无关，她能给你一生的灵感和启发。'),(41,61,'超级幽默，知识讲的很透彻 ，高分小推手'),(42,46,'俊哥上课认真幽默，知识点讲解仔细。课后还会时常关心学生各方面的问题，是个认真负责的好老师！力推！力推'),(43,46,'像俊哥这样的好老师，现在已经真的很难找了！'),(44,46,'认真细心洒脱坚毅优秀并且热爱生活还是千万少女梦的逻辑怪'),(45,46,'要是出道了，绝对挺死！！！'),(46,46,'第一次上俊哥的课，俊哥就在课堂上用手磨咖啡、酒精灯来解释物理变化和化学变化，当时我就震惊了：化学还可以这样学！后来的课我就跟着俊哥走，学到了很多学校老师不会讲到的知识点和方法，这些俊哥的“独门秘笈”奠定了我化学良好的基础为后来的重难题做了铺垫'),(47,46,'俊哥讲课特别生动，用自己独特的方式讲解。课堂气氛特别好，特别喜欢她'),(48,46,'俊哥的课真的特别有趣！！！！有时还会给你好多惊喜！！！超级爱她'),(49,61,'从家到索菲特的公交要坐一个小时，这3600秒是我对老王坚持不懈的喜爱(老王就喜欢搞这些文绉绉的)'),(50,46,'我爱俊哥大爱俊哥！！各位报班不亏！！！！！！'),(51,46,'俊哥的课逻辑性很强，上课认真幽默，课下也很负责。是一位优秀的化学老师'),(52,46,'俊哥是让你初高中化学成为优势学科的最佳选择，且她是会给你带来一生的灵感和启示的老师。'),(53,46,'俊哥上课真的很棒，非常非常非常好'),(54,46,'大爱俊哥！！！各位报班不亏！！！'),(55,46,'超级厉害的老师，绝对第一选择的俊哥！'),(56,46,'俊哥上课幽默风趣，专门教我们简便的化学记忆方法，课堂氛围超级好，今年第一次上就喜欢上了，对了俊哥泡的酒超好喝(･ิϖ･ิ)っ'),(57,46,'课堂幽默风趣不失内涵 集咖啡调酒技能于一身 老帅了 你值得拥有'),(58,61,'老王真的超级好，上课风格幽默风趣，是很好的老师'),(59,61,'非常负责的一位老师，孩子交给他很放心！'),(60,61,'跟了老王两年了，超级喜欢老王的课，高中继续！'),(61,46,'讲台上俊哥是宇宙最强甄子丹！！！'),(62,61,'老王是最最最好的物理老师没有之一，上课超级超级有趣，有时还会有东西吃 讲的课简单易懂！'),(63,61,'老王帅呆了，棒棒的'),(64,61,'很爱老王，老王挺幽默的，上课对我们也很好✘会给我们买冰淇淋和奶茶✔'),(65,61,'老王上课很风趣幽默，把知识和生活结合的融会贯通，自己还私底下还自掏腰包的请全班喝奶茶，对待学生平易近人 ，非常喜欢他的课程。'),(66,46,'俊哥是我见过最有魅力的化学老师，上课幽默风趣，有着高于男性的魄力，也有着高于女性的细致，感谢北城这个平台让我认识了这么一位优秀的老师，是她让我爱上了化学，是她帮助我打开了理科世界的大门，是她教会了我许多道理，俊哥就是最牛的！我爱她！'),(68,61,'王老师不仅帅还可爱幽默，上课超有趣'),(69,46,'俊哥上课认真风趣知识点清晰，了解学生，抱她的课绝对不亏'),(71,46,'喜欢俊哥的小灯、还有俊哥的充电宝！还想喝俊哥调的咖啡'),(72,61,'老王很负责，上课也很幽默！孩子们上他的课积极性都很高！'),(73,61,'超级帅气、幽默风趣的明星老师！！！'),(74,61,'析天地之美,辨万物之理，很棒的一位老师'),(75,46,'喜欢俊哥的百搭小灯，喜欢俊哥的高颜值充电宝。想喝俊哥调的咖啡和酒❤️'),(76,46,'跟着陈文俊老师学习的时间里 小孩成绩提高很快而且也变得懂事了，愿意学习了。'),(77,46,'陈文俊从小接受优质教育，教好每个学生的教育理念也就成为了她的机致目标，四海为家求取名师经历。颠簸的十几年，游历四方的文俊开始了她的教育生涯。年轻气盛的陈老师总会陪伴学生，父母不能陪伴孩子身边时，文俊会指导学生正确的生活方式。又或是生活上遇到隐私的困难，她总会给予最有效的帮助。'),(78,46,'孩子从初三就跟着陈文俊老师，化学是孩子最厉害的一科，感谢陈老师。'),(79,96,'孩子很喜欢潘老师，提高也很快，点个赞，谢谢miss潘'),(80,65,'太棒了，最喜欢魏老师的课程了'),(81,73,'欣雨老师上课极具创造性，逻辑缜密，能点燃思维的火花，期待开学见李老师哦，嘿嘿'),(82,68,'张老师很棒棒哦！'),(83,68,'CAT是又严厉又温柔、上课有条理有重点、反正和她的名字一样，就是cat本人'),(84,68,'张老师非常负责，经常不是早到就是课后约时间给娃娃讲题'),(85,68,'CAT应该考虑一下，多录点音频，声音简直不要太好听'),(86,73,'最爱的数学老师，没有之一！！！'),(87,68,'cat老师特别有耐心，有时候想得比我们家长都周到，会替学生着想'),(88,74,'蒋老师的课非常幽默风趣 很亲切 上课压力不大 能尽情发挥自己的想象力和创造力'),(89,80,'非常优秀的老师'),(90,64,'hin棒！最爱(⑉°з°)-♡'),(91,65,'魏老师的语文课，清新脱俗，活灵活现'),(92,40,'蛙哥化学，终生难忘啊'),(93,65,'魏老师让我从惧怕写作，到爱上写作。可能除了她精湛的教学技术之外，还有她18岁的盛世美颜吧'),(94,67,'成俊老师的语文课，是我的最爱(⑉°з°)-♡'),(95,114,'老师很耐心。讲的思路也清晰，点赞'),(96,49,'最爱彭老师'),(98,58,'电路的艺术'),(99,120,'如同化学反应一般的奇妙体验'),(100,49,'上了彭彭的课感觉语文这方面提高了很多，爱你呀，彭彭！'),(101,49,'升入初中永远不会忘记的老师，很负责任，一开始是因为换老师偶遇了她，因为她我认识了许多朋友，也感谢北城'),(102,49,'上彭老师的的课在各方面都会有很大的进步，课程有趣又有“含金量”。（本人亲自担保，上过课，进步明显，取得优异成绩，评论无误'),(103,49,'可以算彭彭的老生了啊哈，简单来说彭彭的课很有趣，易懂，我很喜欢'),(104,49,'自从上了彭老师的课后，各方面都得到了提高，幽默又有“含金量”的上课方式谁不喜欢呢？？！！（本人亲自担保，体验课程后，进步明显，童话）'),(105,49,'彭彭在上课时对我们很好，像一个好姐姐，和我们融入在一起，相信我，选择彭老师没有错哦！'),(106,49,'挺喜欢彭老师的课的啊哈，上课很有趣，然后也给我了阅读的一些方向吧'),(107,49,'很爱彭老师，也非常希望在初中能彭老师上彭老师的课程'),(108,49,'彭老师的课非常精彩也有趣，我非常的希望上了初中在这里还可以继续上彭老师的课'),(109,49,'很喜欢彭老师，上彭老师的课不觉得枯燥无聊，爱彭老师'),(110,49,'很喜欢彭老师，喜欢上她的课，上完之后觉得语文没有想象的那么无聊枯燥'),(111,49,'我现在六年级了我是从四年级上她的课的');
