DROP TABLE IF EXISTS `course`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `course` (
  `curid` int(11) NOT NULL AUTO_INCREMENT,
  `roomname` varchar(300) NOT NULL,
  `teacher` varchar(300) NOT NULL,
  `subject` varchar(300) NOT NULL,
  `price` int(11) NOT NULL,
  `campus` varchar(100) NOT NULL COMMENT '校区',
  `startdate` varchar(100) NOT NULL COMMENT '开课日期',
  `classdate` varchar(3000) NOT NULL COMMENT '周几',
  `enddate` varchar(100) NOT NULL COMMENT '结束时间',
  `remarks` varchar(100) NOT NULL,
  `grade` varchar(100) NOT NULL,
  `classtime` int(11) NOT NULL COMMENT '课时',
  `label` varchar(100) NOT NULL COMMENT '标签',
  `classtype` varchar(100) NOT NULL COMMENT '班型',
  `classname` varchar(300) NOT NULL COMMENT '班级名',
  `handler` varchar(100) NOT NULL COMMENT '经手人',
  `password` varchar(300) NOT NULL COMMENT '经手人密码',
  PRIMARY KEY (`curid`)
) ENGINE=InnoDB AUTO_INCREMENT=508 DEFAULT CHARSET=utf8;
