INSERT INTO `miaosha` VALUES (1,'王大超老师课程秒杀','https://www.bcjy.online/static/imgs/wangdachaomiaosha1.png','https://www.bcjy.online/static/imgs/miaoshahead2.png',6,'https://www.bcjy.online/static/imgs/wangdachao.jpg','','block','none'),(2,'张洪辉化学课程五折秒杀','https://www.bcjy.online/static/imgs/zhanghonghuimiaosha.png','https://www.bcjy.online/static/imgs/miaoshahead.png',20,'https://www.bcjy.online/static/imgs/honghui1.jpg','<p style=\"margin-left:4%;font-weight:600;margin-top:5%;font-size:14pt\" >*老师介绍:</p> <img src=\"https://www.bcjy.online/static/imgs/zhhcard.jpg\"  style=\"width: 100%; float: left; margin-bottom: 2%;\" ><p class=\"title2\" >1.授课班型<a style=\"color:#848484\" class=\"title3\" >北城·轻骑兵</a></p> <p class=\"title2\" >2.授课学段 <a style=\"color:#848484\" class=\"title3\" >初高中</a> </p> <p class=\"title2\" >3.教学经验 <a style=\"color:#848484\" class=\"title3\" >3年中高考一线化学教学经验</a></p> <p class=\"title2\" >4.教学特点 <a style=\"color:#848484\" class=\"title3\" >课堂活跃，激发学生的学习的积极性引导学生思考和解决遇到的问题</a></p> <p class=\"title2\" >5.教学成绩 <a style=\"color:#848484\" class=\"title3\" >帮助学生提高中考化学分数34分</a></p> <p class=\"title2\" >6.教学服务 <a style=\"color:#848484\" class=\"title3\" >定期学情沟通每日测试及反馈,提供每次课的课堂重点及笔记</a></p> <p style=\"margin-left:4%;font-weight:600;margin-top:5%;font-size:14pt\" >*课程内容:</p> <p class=\"title2\" >初三年级</p> <p class=\"title3\" >1、金属综合复习</p> <p class=\"title3\" >2、溶液综合复习</p> <p class=\"title3\" >3、常见酸及酸的性质</p> <p class=\"title3\" >4、常见碱及碱的性质</p> <p class=\"title3\" >5、酸碱中和反应</p> <p class=\"title3\" >6、常见的盐及其性质</p> <p class=\"title3\" >7、复分解反应</p> <p class=\"title3\" >8、盐与化肥</p> <p class=\"title3\" >9、粗盐提纯与酸碱盐综合</p> <p class=\"title3\" >10、化学与生活</p> <p class=\"title3\" >11、中考模拟测试及讲解(一)</p> <p class=\"title3\" >12、中考模拟测试及讲解(二)</p> <p class=\"title2\" >高一年级</p> <p class=\"title3\" >1、两大反应复习</p> <p class=\"title3\" >2、金属非金属化合物性质及转化</p> <p class=\"title3\" >3、元素周期表</p> <p class=\"title3\" >4、碱金属与卤素</p> <p class=\"title3\" >5、元素周期律</p> <p class=\"title3\" >6、原子结构与化学键</p> <p class=\"title3\" >7、热化学基础</p> <p class=\"title3\" >8、电化学基础</p> <p class=\"title3\" >9、化学反应速率</p> <p class=\"title3\" >10、综合复习</p>','block','none'),(3,'数萌思维春季体验课','https://www.bcjy.online/static/imgs/wangdachaomiaosha1.png','https://www.bcjy.online/static/imgs/miaoshahead2.png',21,'https://www.bcjy.online/static/smimgs/smcover1.jpg','','none','block'),(4,'高一数学王大超，专题集训课程','https://www.bcjy.online/static/imgs/wangdachaomiaosha1.png','https://www.bcjy.online/static/imgs/miaoshahead2.png',10,'https://www.bcjy.online/static/imgs/wangdachao.jpg','','none','block');
