DROP TABLE IF EXISTS `registration`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `registration` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `stuid` int(11) NOT NULL,
  `stuname` varchar(1000) NOT NULL COMMENT '学生姓名',
  `grade` varchar(100) NOT NULL,
  `campus` varchar(300) NOT NULL COMMENT '校区',
  `tell` varchar(100) NOT NULL COMMENT '联系电话',
  `date` varchar(100) NOT NULL COMMENT '处理日期',
  `recampus` varchar(100) NOT NULL COMMENT '受理校区',
  `subject` varchar(100) NOT NULL COMMENT '原科目/停课科目',
  `resubject` varchar(100) NOT NULL COMMENT '现科目',
  `courid` int(11) NOT NULL COMMENT '原课程/停课课程ID',
  `recoid` int(11) NOT NULL COMMENT '现课程ID',
  `time` int(11) NOT NULL COMMENT '转出/停课课时',
  `retime` int(11) NOT NULL COMMENT '转入课时',
  `reprice` int(6) NOT NULL COMMENT '差价/冻转/退费金额',
  `diff` int(1) NOT NULL COMMENT '是否有调班差价/使用冻转金额',
  `quarter` varchar(100) NOT NULL COMMENT '季度',
  `handler` varchar(100) NOT NULL COMMENT '经手人',
  `password` varchar(300) NOT NULL,
  `label` varchar(100) NOT NULL COMMENT '异动类型',
  `classtype` varchar(100) NOT NULL COMMENT '班型',
  `retype` varchar(100) NOT NULL COMMENT '现转班型',
  `clname` varchar(1000) NOT NULL COMMENT '原课程名',
  `reclname` varchar(1000) NOT NULL COMMENT '现课程名',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COMMENT='转班停课课时转移登记表';
